ce: undefined, // dark\\n  // \u66f4\u65b0\u65f6\u95f4\\n  lastUpdated: true,\\n\\n  // \u9879\u76ee\u7684\u6784\u5efa\u8f93\u51fa\u4f4d\u7f6e\\n  outDir: \\"./dist\\",\\n\\n  themeConfig: {\\n    // \u7f51\u7ad9\u6807\u9898\\n    siteTitle: \\"\\",\\n    // \u5fbd\u6807\u6587\u4ef6\\n    logo: \\"/favicon.png\\",\\n    // \u793e\u4ea4\u94fe\u63a5\\n    socialLinks: [{ icon: \\"github\\", link: \\"https://github.com\\" }],\\n    // \u9875\u811a\\n    footer: {\\n      message: \\"\\",\\n      copyright: \\"Copyright \xa9 2023\\",\\n    },\\n    // \u641c\u7d22\\n    search: {\\n      provider: \\"algolia\\",\\n      options: {\\n        appId: \\"...\\",\\n        apiKey: \\"...\\",\\n        indexName: \\"...\\",\\n      },\\n    },\\n    // \u4e0b\u4e00\u4e2a\\n    docFooter: {\\n      prev: \\"\u4e0a\u4e00\u9875\\",\\n      next: \\"\u4e0b\u4e00\u9875\\",\\n    },\\n    // \u6700\u540e\u66f4\u65b0\u65f6\u95f4\\n    lastUpdated: {\\n      text: \\"\u6700\u540e\u66f4\u65b0\u4e8e\\",\\n      formatOptions: {\\n        dateStyle: \\"short\\",\\n        timeStyle: \\"short\\",\\n      },\\n    },\\n\\n    // \u5bfc\u822a\\n    nav: [],\\n\\n    // \u4fa7\u8fb9\u680f\\n    sidebar: {},\\n  },\\n});\\n```\\n\\n### \u4e3b\u9898\\n\\n```js\\n// https://vitepress.dev/guide/custom-theme\\nimport Theme from \\"vitepress/theme\\";\\nimport { h } from \\"vue\\";\\nimport Comments from \\"../components/Comments.vue\\";\\nimport \\"./style.css\\";\\n\\nexport default {\\n  extends: Theme,\\n\\n  Layout: () => {\\n    return h(Theme.Layout, null, {\\n      // \u8fd9\u91cc\u52a0\u8f7d\u8bc4\u8bba\u6a21\u5757\\n      \\"doc-after\\": () => h(Comments),\\n    });\\n  },\\n};\\n```\\n\\n### \u6dfb\u52a0\u8bc4\u8bba\\n\\n\u4f7f\u7528 giscus \u5b9e\u73b0\u8bc4\u8bba\u529f\u80fd\u3002[https://giscus.app](https://giscus.app)\\n![](./public/image.png)\\n\u5b8c\u6210\u4e0a\u9762\u4e09\u6b65\u9aa4\uff0c\u5373\u53ef\u9a8c\u8bc1\u3002\\n\\n#### \u5b89\u88c5\\n\\n```sh\\npnpm add @giscus/vue\\